import './App.css';

function App () {
  function handleSubmit (e) {
    e.preventDefault();
    console.log('Working');
  }
  return (
    <div className="App">
      <form onSubmit={handleSubmit}>
        <input type="number" placeholder="Enter transaction" />
        <input type="text" placeholder="Enter transaction details" />
        <input type="date" />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
